import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

function AllTreks(){
    return (
    <div className="container my-4">
      <div className="row border p-4 rounded">
        <div className="col-md-4">
          <img src="trek-image.jpg" alt="Trek Image" className="img-fluid" />
        </div>
        <div className="col-md-8">
          <h2>Raigad Trek</h2>
          <p>Location: </p>
          <p>Duration: 7 days</p>
          <p>Approx: 37Km</p>
          <p>Grade: Moderate</p>
          <p>Altitude: 12100Ft.</p>
          <a href="book-trek.html" className="btn btn-primary">Book Now</a>
        </div>
      </div>
    </div>
  );
}

export default AllTreks;
